member.summary:
Cached points.

Can be overridden like this: Points["ScreenCenter"] = GamePoint.MakeFromPercent(50, 50);
Or like this: Points["ScreenCenter"] = () => GamePoint.MakeFromPercent(50, 50);

If you use the second method and InbDeferCache is true, it calls the action when it has to get the value and then caches it, otherwise it calls the action immediately to cache the value.

Cached regions.

Can be overridden like this: Regions["ScreenCenter"] = GameRegion.MakeFromGameCoordsClamped(0, 0, 100, 100);
Or like this: Regions["ScreenCenter"] = () => GameRegion.MakeFromGameCoordsClamped(0, 0, 100, 100);

If you use the second method and InbDeferCache is true, it calls the action when it has to get the value and then caches it, otherwise it calls the action immediately to cache the value.

Cached grids.

Can be overridden like this: Grids["Inventory"] = new GameGrid(GameRegion.MakeFromGameCoordsClamped(0, 0, 100, 100), ...);
Or like this: Grids["Inventory"] = () => new GameGrid(GameRegion.MakeFromGameCoordsClamped(0, 0, 100, 100), ...);

If you use the second method and InbDeferCache is true, it calls the action when it has to get the value and then caches it, otherwise it calls the action immediately to cache the value.
